	return(
		<div className="item-list-container">
			<h3>Bienvenido <strong>{props.greeting} a HIGH FIDELITY</strong> <br />la tienda de discos usados más grande de Sudamérica</h3>
		</div>
	)
}

export default ItemListContainer
